/* variables */
:root {
	--bg: white;
	--font: 'PT Serif';
	--line: #ddd;
}

/* 

--- remove ---

*/
/* панель юзера */
#p-personal,

/* обсуждение страницы */
#left-navigation,

/* Читать или править */
#p-views,

/* Банер объявления сверху */
#siteNotice,

/* Боковые панели */
#p-navigation,

/* Боковые панели */
#p-participation,

/* Боковые панели */
#p-tb,

/* Боковые панели */
#p-coll-print_export,

/* Боковые панели */
#p-wikibase-otherprojects,

/* заголовок раздела языков */
#p-lang-label,

/* заголовок раздела языков */
.uls-settings-trigger,

/* управление ссылками на языковые версии */
.after-portlet-lang,

/* Материал из Википедии — свободной энциклопедии */
#siteSub,

/* Скрыть сворачивалку оглавления */
#mw-fr-reviewnotice,
.mw-editsection,
.toctoggle,
table.ambox {
	display: none;
}

/* clean borders */
* {
	border: none !important;
}

/* 

--- content ---

*/
.mw-parser-output li {
	font-family: var(--font);
}
.mw-parser-output > ul,
.mw-parser-output > ol,
.mw-parser-output > p {
	font-family: var(--font) !important;
	font-size: 1.6rem !important;
	line-height: 1.5 !important;
}
.mw-parser-output > h1 {
	font-family: var(--font) !important;
	font-size: 2.4rem !important;
}
.mw-parser-output > h2 {
	font-family: var(--font) !important;
	font-size: 2.1rem !important;
}
.mw-parser-output > h3 {
	font-family: var(--font) !important;
	font-size: 1.9rem !important;
}
.mw-parser-output > h4 {
	font-family: var(--font) !important;
	font-size: 1.7rem !important;
}
.mw-parser-output > h5 {
	font-family: var(--font) !important;
	font-size: 1.5rem !important;
}
.mw-parser-output > h6 {
	font-family: var(--font) !important;
	font-size: 1.3rem !important;
}
.mw-body-content p,
.mw-content-ltr ul,
.mw-content-rtl .mw-content-ltr ul {
	padding: 0px 10% 0 0;
	max-width: 45em;
}

/*  */
.mw-body h1,
.mw-body-content h1 {
	font-size: 2.5em;
}

/*  */
h1,
.mw-body-content h2 {
	font-family: var(--font) !important;
}

/*  */
.mw-body-content h3,
.mw-body-content h4,
.mw-body-content h5,
.mw-body-content h6 {
	margin-top: 1em;
}

/*  */
.mw-body-content h2 {
	margin-top: 2em;
	font-size: 1.8em;
}

/* поиск */
div#simpleSearch {
	outline: 10px;
	padding: 10px 30px 10px 15px;
}

/*  */

div#simpleSearch:focus {
	background: var(--bg);
}

/*  */
#right-navigation {
	margin-top: 0;
}

/* отступ над заголовком */
#mw-head-base {
	height: 0;
}

/* ссылки на источники забледняем */
.reference {
	position: relative;
	background-color: var(--bg);
	margin-left: -1px;
	opacity: 0.4;
	font-size: 60% !important;
}

/*  */
.reference:hover {
	opacity: 1;
}

/* скрываем квадратные скобки */
.reference:before {
	content: "[";
	position: absolute;
	top: 2px;
	left: 0;
	background-color: var(--bg);
	color: var(--bg);
}

/* скрываем квадратные скобки */
.reference:after {
	content: "]";
	position: absolute;
	top: 2px;
	right: 0;
	background-color: var(--bg);
	color: var(--bg);
}

/* убираем буллеты у списков */
ul {
	list-style-type: none;
	list-style-image: none;
}

/*  */
li:before {
	_content: "— ";
	_margin-left: -1.3em;
}

/*  */
li {
	margin: 0.5em 0;
}

/* цитаты */
blockquote {
	font-style: italic;
	font-family: var(--font);
	background: none;
	font-size: 1.2em;
	letter-spacing: 0.015em;
	max-width: 40em;
	margin-top: 1.3em;
}

/* убираем подложки под картинками */
div.thumbinner {
	background: none;
}

/* картинки слева перебрасываем направо */
.thumb.tleft {
	clear: right;
	float: right;
	margin: 0.5em 0 1.3em 4.4em;
}

/* отступ слева у правых блоков */
div.tright {
	margin-left: 4.4em;
}

/* Ссылки на геолокации на разных сервисах */
