body:not([onload]) p b {
	_color: var(--light);
  font-weight: normal !important;
}

.msgbody,
.msgframe_bottomcenter,
.msgframe_bottomcenter > table > tbody > tr:nth-of-type(3) > td,
.msgframe_topcenter,
_ {
	padding: 0;
}
.msgbody {
  position: relative;
	top: -20px !important;
}
.posttofrom {
