}
.sig, .sig *, .sig a {
	color: var(--light);
	font-size: .8rem;
	font-style: italic;
	text-align: left;
}
.sig br+br {
	font-size: 0;
}
.sig p {
	padding: 0;
	margin: 0;
}
.edit_text {
	margin: 0;
	color: var(--light);
}

/* message buttons */
.postresponse,
.postresponse td,
_ {
